"<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\n"
"p, li { white-space: pre-wrap; }\n"
"</style></head><body style=\" font-family:\'Century Gothic\'; font-size:7.8pt; font-weight:400; font-style:normal;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:14pt; color:#000000;\">        </span></p>\n"
"<p align=\"center\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:16pt; font-weight:600; color:#000000;\">Eisenhowerova matica</span><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:16pt; color:#000000;\"> </span></p>\n"
"<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'MS Shell Dlg 2\'; font-size:16pt; color:#000000;\"><br /></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:30px; margin-right:30px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; color:#000000;\">sa skladá zo štyroch kvadrantov, kde každý jeden z nich značí prioritu, ktorú máme venovať danej aktivite. Pomyselné osi nám pomáhajú k určeniu správnej priority. Osi značia: Urgentnosť/Neurgentnosť, Dôležitosť/Nedôležitosť. Na základe danej aktivity môžeme teda určiť, či je aktivita urgentná/neurgentná a dôležitá/nedôležitá. Po zodpovedaní týchto otázok sme schopní učiť správnu prioritu danej aktivity a umiestniť ju do jedného z kvadrantov.                </span></p>\n"
"<p align=\"center\" style=\" margin-top:12px; margin-bottom:12px; margin-left:30px; margin-right:30px; -qt-block-indent:0; text-indent:0px;\"><img src=\"user/matica.jpg\" /><span style=\" font-size:14pt; color:#000000;\">        </span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; color:#000000;\">   </span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; color:#000000;\">         </span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:30px; margin-right:30px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; font-weight:600; color:#000000;\">Čo je dôležité a čo urgentné?</span><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:14pt; color:#000000;\"><br /><br /></span><span style=\" font-size:14pt; font-weight:600; color:#000000;\">Urgentnosť:</span><span style=\" font-size:14pt; color:#000000;\"> hovorí o tom, čo horí, a čo nie. Ak je úloha časovo senzitívna (mám externý deadline na dane, deadline na IFJ projekt je za týždeň a môj tím ešte nezačal pracovať), zdroje na jej vykonanie sú obmedzené časom (kolega mi odchádza zajtra na dovolenku), je kritická pre začatie inej úlohy, patrí medzi urgentné.<br /><br /></span><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:14pt; font-weight:600; color:#000000;\">Dôležitosť:</span><span style=\" font-size:14pt; color:#000000;\"> miera toho, ako výrazne ma dokáže daný krok, aktivita, projekt, ovplyvniť alebo posunúť k naplneniu mojich cieľov, nakoľko prispieva k môjmu želanému stavu. Príkladom pre študenta môže byť projekt, bez ktorého nezíska zápočet a predmet bude musieť opakovať.                </span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; color:#000000;\">      </span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; color:#000000;\">     </span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:30px; margin-right:30px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; font-weight:600; color:#000000;\">Čo v prípade, že sme pre našu aktivitu našli správny kvadrant v matici?</span><span style=\" font-size:14pt; color:#000000;\"><br /><br />            Mali by ste postupovať nasledovne:<br />            </span><span style=\" font-size:14pt; font-weight:600; color:#000000;\">1.    Urgentné – dôležité:</span><span style=\" font-size:14pt; color:#000000;\"> Urob hneď!<br />            </span><span style=\" font-size:14pt; font-weight:600; color:#000000;\">2.    Neurgetné – dôležité:</span><span style=\" font-size:14pt; color:#000000;\"> Naplánuj si!<br />            </span><span style=\" font-size:14pt; font-weight:600; color:#000000;\">3.    Urgentné – nedôležité:</span><span style=\" font-size:14pt; color:#000000;\"> Deleguj!<br />            </span><span style=\" font-size:14pt; font-weight:600; color:#000000;\">4.    Neurgetné – nedôležité:</span><span style=\" font-size:14pt; color:#000000;\"> Nerob, odstráň!<br />            <br /><br />Veríme že Vám Eisenhowerova matica pomôže s Vašim Time managementom a že našu aplikáciu využijete naplno.<br />            <br /></span><span style=\" font-size:14pt; font-weight:600; color:#000000;\">Tím BrainFree.</span><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:14pt; color:#000000;\">            </span></p>\n"
